const data = {
  services: [
    {
      name: 'Spray Weeds',
      slug: 'Weed Spray',
      image: '/images/spray.jpg',
      description:
        'We charge based off of square footage and difficulty of spray',
    },
    {
      name: 'Clean Up',
      slug: 'Clean Weeds',
      image: '/images/clean.jpg',
      description:
        'We charge based off of square footage and difficulty of spray',
    },
  ],
};

export default data;
